import React, { useState } from 'react';
import { Card } from 'primereact/card';
import { InputText } from 'primereact/inputtext';
import { Password } from 'primereact/password';
import { Dropdown } from 'primereact/dropdown';
import { Button } from 'primereact/button';
import { Message } from 'primereact/message';
import { userAPI } from '../services/api';
import './CreateUser.css';

const CreateUser: React.FC = () => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [role, setRole] = useState<'user' | 'admin'>('user');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const [emailError, setEmailError] = useState('');

  const roleOptions = [
    { label: 'Korisnik', value: 'user' },
    { label: 'Administrator', value: 'admin' },
  ];

  const validateEmail = (value: string) => {
    // RFC5322-ish simple validation
    const pattern = /^[^\s@]+@[^\s@]+\.[^\s@]{2,}$/;
    return pattern.test(value);
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setError('');
    setSuccess('');
    setEmailError('');

    if (!validateEmail(email)) {
      setEmailError('Unesite validnu email adresu.');
      return;
    }

    setLoading(true);

    try {
      await userAPI.createUser(name, email, password, role);
      setSuccess('Korisnik je uspešno kreiran. Poslat je email za verifikaciju.');
      setName('');
      setEmail('');
      setPassword('');
      setRole('user');
    } catch (err: any) {
      setError(err.response?.data?.message || 'Greška pri kreiranju korisnika');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="create-user">
      <div className="cu-header">
        <div className="cu-header-icon">
          <i className="pi pi-user-plus"></i>
        </div>
        <div className="cu-header-text">
          <h2>Kreiraj korisnika</h2>
          <p>Dodaj novog korisnika ili administratora u sistem</p>
        </div>
      </div>

      <Card className="cu-card">
        <form onSubmit={handleSubmit} className="cu-form">
          <div className="cu-grid">
            <div className="cu-col">
              <label htmlFor="name" className="cu-label">Ime i prezime</label>
              <InputText id="name" value={name} onChange={(e) => setName(e.target.value)} className="cu-input" placeholder="npr. Petar Petrović" required />
            </div>

            <div className="cu-col">
              <label htmlFor="email" className="cu-label">Email</label>
              <InputText 
                id="email" 
                type="email" 
                value={email} 
                onChange={(e) => {
                  setEmail(e.target.value);
                  if (emailError) setEmailError('');
                }} 
                className={`cu-input ${emailError ? 'cu-input-error' : ''}`} 
                placeholder="npr. petar@example.com" 
                required 
              />
              {emailError && <small className="cu-error-text">{emailError}</small>}
            </div>

            <div className="cu-col">
              <label htmlFor="password" className="cu-label">Lozinka</label>
              <Password id="password" value={password} onChange={(e) => setPassword(e.target.value)} className="cu-input" feedback={false} toggleMask placeholder="Unesi lozinku" required />
            </div>

            <div className="cu-col">
              <label htmlFor="role" className="cu-label">Uloga</label>
              <Dropdown id="role" value={role} options={roleOptions} onChange={(e) => setRole(e.value)} className="cu-input" placeholder="Izaberi ulogu" />
            </div>
          </div>

          <div className="cu-messages">
            {error && <Message severity="error" text={error} className="cu-message" />}
            {success && <Message severity="success" text={success} className="cu-message" />}
          </div>

          <div className="cu-actions">
            <Button type="submit" label="Kreiraj korisnika" icon="pi pi-check" className="cu-submit" loading={loading} />
          </div>
        </form>
      </Card>
    </div>
  );
};

export default CreateUser;
